 z.load("com.databricks:spark-csv_2.10:1.5.0")
//
// note: (I've commented out the profilers jar - it's not needed in this notebook)
// z.load("/home/zeppelin/profilers-1.0.0.jar")
//
// The profiler code is available from the github for the book. It needs compiling to a jar.
// Then you need to deploy the profiler jar into a directory that Zeppelin has access to. 
// I used /home/zeppelin, a non-hdfs directory on the namenode. 
//

// NOTE: I have disabled the SCALA based processes in this notebook, but some of them in to demonstrate the scala way, they are placed inline adjacent to the pyspark ones.
